import React from 'react';
import styled from 'styled-components';
import { colors } from '../../styles';

const Btn = styled.div`
  width: 80px;
  height: 80px;
  border-radius: 50%;
  background-color: ${colors().orange};
  position: fixed;
  bottom: 0;
  right: 0;
`;

function BackBtn() {
  return <Btn></Btn>;
}

export default BackBtn;
